import ReactDOM from 'react-dom';
import './index.css';

function CustomerInfo(props){
    return(
        <form>
                <label>
                    {props.question + " "}
                </label>
                <input type = "text"/>

            </form>
    )
}


class Calculator extends React.Component{


    render(){
        return(
            <form>
                <CustomerInfo
                question = "How many miles have you driven this year?"
                />
                <CustomerInfo
                question = "How much have you paid for insurance this year?"
                />
                <CustomerInfo
                question = "How many miles have you drive this year?"
                />

                <button>
                    calculate!
                </button>
            </form>
        );
    }
}

